CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_actualizar_capacidad` (`_id_locales` INT, `_num_vendedores` INT)  BEGIN


UPDATE tbl_local
SET num_vendedores=_num_vendedores WHERE id_locales=_id_locales;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_deta_vende_pro` (IN `_id_vendedor` INT, `_id_producto` INT)  BEGIN
		insert into tbl_detalle_producto(id_vendedor,id_producto)
        values(_id_vendedor,_id_producto);

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_factura` (`_id_usuario` INT(11))  BEGIN
	  SELECT v.nombres_vendedor,v.dni_vendedor,v.rubro,v.fecha_reserva_inicio,l.precio_alqui,l.nomb_lcl,c.Num_comprobante 
FROM tbl_vendedor v INNER JOIN tbl_local l on v.id_locales=l.id_locales
 INNER JOIN tbl_comprobante c on v.id_comprobante=c.Num_comprobante inner join 
 tbl_usuario u on v.id_usuario =u.id_usuario
  where u.id_usuario=_id_usuario and Num_comprobante=(SELECT MAX(Num_comprobante) from tbl_comprobante)
;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_iniciar_sesion` (IN `_nombreusuario` VARCHAR(45), `_contrausuario` VARCHAR(45))  BEGIN
		select id_usuario,nombre_usuario, contra_usuario,tipo_usuario from tbl_usuario where nombre_usuario =_nombreusuario and contra_usuario = _contrausuario;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_insertar_usuario` (IN `_nombreusuario` VARCHAR(45), `_contrausuario` VARCHAR(45), `_tipousuario` VARCHAR(45), `_emailusuario` VARCHAR(60))  BEGIN
INSERT INTO tbl_usuario( nombre_usuario, contra_usuario,tipo_usuario,email)
    VALUES (_nombreusuario,_contrausuario,_tipousuario,_emailusuario);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_monto_total` (`_id_locales` INT(11), `_fecha_desde` DATETIME, `_fecha_hasta` DATETIME)  BEGIN
select 
SUM(precio_alqui)as total,nomb_lcl from tbl_vendedor v inner join tbl_local l on
v.id_locales=l.id_locales where STR_TO_DATE(fecha_reserva_inicio,'%d-%m-%Y')>=_fecha_desde 
and STR_TO_DATE(fecha_reserva_inicio,'%d-%m-%Y') <=_fecha_hasta and v.id_locales=_id_locales;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_mostrar_mi_local` (`_id_usuario` INT(11))  BEGIN
SELECT* FROM tbl_local l INNER JOIN tbl_usuario u on l.id_usuario=u.id_usuario
 where l.id_usuario=_id_usuario;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_registrar_comprobante` (IN `_Num_comprobante` INT)  BEGIN
insert into tbl_comprobante(Num_comprobante) values (_Num_comprobante);

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_registrar_local` (IN `_nombre_dueno` VARCHAR(50), `_dni_dueno` CHAR(8), `_nomb_lcl` VARCHAR(45), `_ubicacion` VARCHAR(150), `_tipo` VARCHAR(50), `_medidas` VARCHAR(30), `_fotografia` LONGBLOB, `_servicios` VARCHAR(50), `_num_vendedores` INT(11), `_capacidad` INT(11), `_precio_alqui` FLOAT, `_telefono` VARCHAR(15), `_email_dueno` VARCHAR(60), `_id_usuario` INT(11))  BEGIN
		insert into tbl_local(nombre_dueno,dni_dueno,nomb_lcl,ubicacion,
        tipo,medidas,fotografia,servicios,num_vendedores,capacidad,precio_alqui,telefono,email_dueno,id_usuario) values
        (_nombre_dueno,_dni_dueno,_nomb_lcl,_ubicacion,
        _tipo,_medidas,_fotografia,_servicios,_num_vendedores,_capacidad,_precio_alqui,_telefono,_email_dueno,_id_usuario);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_registrar_producto` (IN `_nom_producto` VARCHAR(30), `_precio` FLOAT, `_cantida` INT)  BEGIN

insert into tbl_producto(nom_producto,precio,cantida) 
values (_nom_producto,_precio,_cantida);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_registrar_vendedor` (IN `_nombres_vendedor` VARCHAR(50), `_dni_vendedor` CHAR(8), `_rubro` VARCHAR(30), `_email` VARCHAR(60), `_telef` VARCHAR(15), `_fecha_reserva_inicio` VARCHAR(30), `_id_locales` INT, `_id_comprobante` INT, `_id_usuario` INT(11))  BEGIN
insert into tbl_vendedor(nombres_vendedor,dni_vendedor,rubro,email,telef,fecha_reserva_inicio,id_locales,id_comprobante,id_usuario) 
values (_nombres_vendedor,_dni_vendedor,_rubro,_email,_telef,_fecha_reserva_inicio,_id_locales,_id_comprobante,_id_usuario);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reporte_local` (`_fecha_desde` DATETIME, `_fecha_hasta` DATETIME, `_id_locales` INT(11))  BEGIN
select nombres_vendedor,dni_vendedor,rubro,fecha_reserva_inicio,
precio_alqui,Num_comprobante,nomb_lcl from tbl_vendedor v inner join tbl_local l on
v.id_locales=l.id_locales inner join tbl_comprobante c on v.id_comprobante=c.id_comprobante
where  STR_TO_DATE(fecha_reserva_inicio,'%d-%m-%Y') >=_fecha_desde
 and STR_TO_DATE(fecha_reserva_inicio,'%d-%m-%Y') <=_fecha_hasta
 and l.id_locales=_id_locales;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_volver_capacidad` ()  BEGIN


UPDATE tbl_local
SET num_vendedores=capacidad ;
END$$

